import React from 'react';
import {View,Text} from 'react-native';


const Chats = () => {
    return(
        <View style={{
            flex:1,
            alignItems:'center',
            justifyContent:'center'
        }}>
            <Text>Chats Screen</Text>
        </View>
    )
}
export default Chats;
